import LoginComp from './LoginPage';
import {Switch, Route} from 'react-router-dom'
import AllMoviesComp from './movies/AllMovies';
import EditMovieComp from './movies/EditMovie'
import AddMovieComp from './movies/AddMovie';
import AllMembersComp from './members/AllMembers';
import EditMemberComp from './members/EditMember';
import AddMemberComp from './members/AddMember';

function MainComp(props) {

  const navToAllMovies = ()=> 
{
  props.history.push('/movies')

}
  return (

    <div className="App">


       <Switch>
      <Route path="/movies" component={AllMoviesComp} /> 
      <Route path="/edit-movie/:id" component={EditMovieComp} /> 
      <Route path="/add-movie" component={AddMovieComp} /> 

      <Route path="/members" component={AllMembersComp} /> 
      <Route path="/edit-member/:id" component={EditMemberComp} /> 
      <Route path="/add-member" component={AddMemberComp} />  


      <Route exact path="/" component={LoginComp} />  


    </Switch>


<h2>Movies Subscription WebSite</h2>
<nav>
 <button onClick={navToAllMovies}>Movies</button> &nbsp;
 <button>Subscription</button> &nbsp;
 <button>Log Out</button>

</nav>

    </div>
  );
}

export default MainComp;
